using System;\nusing System.Collections.Generic;\nusing com.atlassian.jira.rpc.soap.beans;\n\n// Assuming you have a JiraSoapService instance named 'jiraService'\nJiraSoapService jiraService = new JiraSoapService();\n\n// Login to JIRA\nstring token = jiraService.login("your_username", "your_password");\n\n// Get the project key\nstring projectKey = "YOUR_PROJECT_KEY";\n\n// Get the assignable users for the project\nRemoteUser[] assignableUsers = jiraService.getAssignableUsers(token, projectKey);\n\n// Print the usernames\nforeach (RemoteUser user in assignableUsers)\n{\n    Console.WriteLine(user.name);\n}\n\n// Don't forget to log out\njiraService.logout(token);